(1019, 'COMPLETE BLOOD COUNT', 'CBC', 'A broad screening test to check for such disorders as anemia, infection, and many other diseases. Includes white blood cell count, red blood cell count, hemoglobin, hematocrit, indices (MCV, MCH, MCHC, RDW), and often includes platelet count.', 'en', 4, '2004-12-02 00:00:00'), 
(1020, 'BANDS', 'BANDS', 'Immature neutrophils with a crescent shaped nucleus, bands are normal in the circulation in small numbers. If there is a percentage increase of them, there is said to be a left shift. This may happen when an acute infection stimulates increased neutrophils production.', 'en', 4, '2004-12-02 00:00:00'), 
