(1023, 'MONOCYTES', 'MONOS', 'Large, circulating, phagocytic white blood cells, having a single well-defined nucleus and very fine granulation in the cytoplasm. Monocytes constitute from 3 to 8 percent of the white blood cells in humans.', 'en', 4, '2004-12-02 00:00:00'), 
