(1025, 'BASOPHILS', 'BASOS', 'Type of leukocyte, with coarse granules that stain blue when exposed to a basic dye. Basophils normally constitute 1% or less of the total white blood cell count but may increase or decrease in certain diseases.', 'en', 4, '2004-12-02 00:00:00'), 
